    const contentStyle = {
        height: '560px',
        color: '#eee',
        fontSize: '50px',
        lineHeight: '560px',
        textAlign: 'center',
        background: '#fff',
    };
    return (
        <>
            <section >
                <p >Hãy quyên góp cho những hoạt động mà bạn quan tâm</p>
            </section>
        </>
    );
}

